import React, { Suspense, useEffect, useState } from "react";
import { Box } from "@mui/material";

import { useParams } from "react-router-dom";
import ResponsiveLayout from "../../ResponsiveLayout/ResponsiveLayout";
import { TestChartContainer } from "./TestChartContainer";

const layoutInitialTwo = [
  { w: 2, h: 8, x: 0, y: 0, i: "a", static: false },
  { w: 2, h: 8, x: 0, y: 0, i: "b", static: false },
  { w: 2, h: 8, x: 0, y: 0, i: "c", static: false },
  { w: 2, h: 8, x: 0, y: 0, i: "d", static: false },
  { w: 2, h: 8, x: 0, y: 0, i: "e", static: false },
];

const PageLayoute = () => {
  const [currentPage, setCurrentPage] = useState();
  const { page, sub, group } = useParams();
  useEffect(() => {
    if (group) {
      setCurrentPage(group);
      return;
    }
    if (sub) {
      setCurrentPage(sub);
      return;
    }
    if (page) {
      setCurrentPage(page);
      return;
    }
  }, [page, sub, group]);

  return (
    <>
      <Box sx={{ width: "100%", position: "relative" }}>
        <h1>{currentPage}</h1>
        <ResponsiveLayout layoutData={layoutInitialTwo}>
          {layoutInitialTwo.map((elem) => (
            <Box key={elem.i}>
              <TestChartContainer />
            </Box>
          ))}
        </ResponsiveLayout>
      </Box>
      <Box
        sx={{
          height: "100%",
          width: "20px",
          backgroundColor: "black",
          position: "absolute",
          right: "0",
          top: "0",
        }}
      />
    </>
  );
};

export default PageLayoute;
